import ValidationInput from "../../validators/ValidationInput"

const Send = (numberOfSets, statusCheckbox) => {
  const statusValidationInput = ValidationInput(numberOfSets);
  if (statusValidationInput) {
    window.location.href = "/room";
  }
};

export default Send;
